import { render } from 'react-dom'
import Contact from './Contact'


function App() {
  return <div style={{display:"flex", gap:"5px"}}>
    <Contact name="James" message="Have a good day!" image="https://img.lovepik.com/element/40128/7461.png_1200.png"/>
    <Contact name="Emmanuel" message="Have a good night!" image="https://img.freepik.com/free-psd/3d-illustration-person-with-sunglasses_23-2149436188.jpg"/>
    <Contact name="Sabrina" message="Have a good afternoon!" image="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS_CQ3IrjZcisW-FO12jxRtSA9shZYuykqA2w&usqp=CAU"/>
  </div>
}

render(<App />, document.getElementById('root'));
